import React, { useState } from "react";
import "./styles/App.css";
function App() {
  let [tasks, setTask] = useState([
    { id: 1, text: "Купить пиво" },
    { id: 2, text: "Купить молоко" },
  ]);
  return (
    <div className="App">
      <div>
        <input />
        <button>Add</button>
        <ul>
          {tasks.map(task=>{
            <li>task</li>
          })}
        </ul>
      </div>
    </div>
  );
}

export default App;
